import React from 'react'
import "./navigation.scss"

const navItems= () => {
    return (
        <div>
            <ul className="navigation-items">
                <li className="nav-link">Build Your Burger</li>
                <li className="nav-link">Checkout</li>
            </ul>
        </div>
    );
};

export default navItems;
